function Submit(){
	const [content, setcontent] = useState('');
	const handlechange = (e) =>{
		setcontent(e.target.value);
	}
	
	const handlesubmit =() =>{
		e.preventDefault();
		console.log(content);
	
}
	
	return(
	<div>
<form onSubmit={handlesubmit} >
<input type="text" onchange={handlechange} ></input>
	<button>Submit</button>
	</form>
	</div>
	
	
	
	)
	
}
export default Submit
